CREATE DEFINER=`root`@`localhost` PROCEDURE `aumentar_sueldo_categoria` (IN `catep` VARCHAR(50), IN `Incremento` DECIMAL(10,2))   BEGIN
    -- Actualizar el sueldo de los empleados que pertenecen a la categoría indicada
    UPDATE empleado
    SET salario = salario * (1 + (Incremento / 100))
    WHERE categoria = catep;
    
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `crear_horario_atraccion` (IN `nombre_atraccion` VARCHAR(50), IN `fecha_inicio` DATETIME, IN `fecha_fin` DATETIME)   BEGIN
    DECLARE id_atraccion INT;
    
    -- Verificar que la fecha de inicio es anterior a la fecha de fin
    IF fecha_inicio >= fecha_fin THEN
        SIGNAL SQLSTATE '45000' 
            SET MESSAGE_TEXT = 'La fecha de inicio debe ser anterior a la fecha de fin.';
    END IF;
    
    -- Obtener el id de la atracción por su nombre
    SELECT id INTO id_atraccion FROM ATRACCION WHERE nombre = nombre_atraccion;
    
    -- Insertar el horario con las variables en la tabla HORARIO
    INSERT INTO HORARIO(fecha_inicio, fecha_fin, idRestaurante, idAtraccion)
    VALUES(fecha_inicio, fecha_fin, NULL, id_atraccion);
    
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `crear_horario_restaurante` (IN `nombre_restaurante` VARCHAR(50), IN `fecha_inicio` DATETIME, IN `fecha_fin` DATETIME)   BEGIN
    DECLARE id_restaurante INT;
    
    -- Verificar que la fecha de inicio es anterior a la fecha de fin
    IF fecha_inicio >= fecha_fin THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'La fecha de inicio debe ser anterior a la fecha de fin.';
    END IF;
    
    -- Obtener el id del restaurante por su nombre
    SELECT id INTO id_restaurante FROM RESTAURANTE WHERE nombre = nombre_restaurante;
    
    -- Insertar el horario en la tabla HORARIO
    INSERT INTO HORARIO(fecha_inicio, fecha_fin, idRestaurante, idAtraccion)
    VALUES(fecha_inicio, fecha_fin, id_restaurante, NULL);
    
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `estaTrabajando` (IN `nombreTrabajador` VARCHAR(255))   BEGIN
    DECLARE trabajando INT;
    SELECT COUNT(*) INTO trabajando FROM empleado
    inner JOIN asignacion ON empleado.id = asignacion.idEmpleado
    inner join horario on horario.id = asignacion.idHorario
    WHERE empleado.nombre = nombreTrabajador AND fecha_inicio <= NOW() AND fecha_fin >= NOW();
    IF trabajando > 0 THEN
        SELECT CONCAT(nombreTrabajador, ' está trabajando actualmente.');
    ELSE
        SELECT CONCAT(nombreTrabajador, ' no está trabajando actualmente.');
    END IF;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `obtener_horarios_restaurante_7dias` (IN `id_restaurante` INT)   BEGIN
  DECLARE fecha_in DATE;
  DECLARE fecha_fi DATE;
  
  -- Calcular la fecha de inicio y fin para la próxima semana
  SET fecha_in = CURDATE();
  SET fecha_fi = DATE_ADD(fecha_in, INTERVAL 7 DAY);
  
  -- Obtener la lista de horarios de ese restaurante con los datos de la fecha, 
  -- el nombre del empleado y el nombre del restaurante
  SELECT horario.fecha_inicio, horario.fecha_fin, empleado.nombre as empleado,
  restaurante.nombre as restaurante
  FROM horario 
  inner join asignacion on horario.id = asignacion.idHorario
  inner join empleado on asignacion.idEmpleado = empleado.id
  inner join restaurante on restaurante.id = horario.idRestaurante
  WHERE idRestaurante = id_restaurante and horario.fecha_inicio >= fecha_in
  and horario.fecha_fin <= fecha_fi;
END$$

